 \*/
public class DataBase \{

 private Connection connection\;
 private Statement statement\;
 private ResultSet rs\;

 private String url\;
 private String user\;
 private String password\;
 private String sqlCMD\;

 private Document dom\;


 //\=\=\=\=\=\=\=\=\=\=\=\=\=\=\=\=\=\=\=\=\=\=\=\=\=\=\=\=\=\=\=
