 public String getUrl\(\) \{
 return url\;
 \}

 public String getUser\(\) \{
 return user\;
 \}

 public String getPassword\(\) \{
 return password\;
 \}

 public String getSqlCMD\(\) \{
 return sqlCMD\;
 \}

 public Statement getStatement\(\) \{
 return statement\;
 \}

 //End
