 /\*\*
 \* 构造方法\，初始化数据库
 \*/
 public DataBase\(\) \{
 try \{
 Class\.forName\("com\.mysql\.jdbc\.Driver"\)\;
 \} catch \(ClassNotFoundException e\) \{
 System\.err\.println\("数据库驱动加载失败"\)\;
 e\.printStackTrace\(\)\;
 \}
 \}

 public DataBase\(String url\, String user\, String password\) \{
 this\(\)\;
 this\.url \= url\;
 this\.user \= user\;
 this\.password \= password\;
 \}
 //End
 //创建内部变量
 //\=\=\=\=\=\=\=\=\=\=\=\=\=\=\=\=\=\=\=\=\=\=\=\=\=\=\=\=\=\=\=


 /\*\*
 \* 连接数据库
 \*/
 public void contect\(\) \{
 try \{
 if \(this\.user \=\= null \| this\.password \=\= null\) \{
 System\.err\.println\("用户名或密码未设置"\)\;
 this\.connection \= null\;
 \} else if \(this\.user\.equals\(""\) \| this\.password\.equals\(""\)\) \{
 this\.connection \= DriverManager\.getConnection\(this\.url\)\;
 \} else if \(\!\(this\.user\.equals\(""\) \& this\.password\.equals\(""\)\)\) \{
 this\.connection \= DriverManager\.getConnection\(this\.url\, this\.user\, this\.password\)\;
 \}
 \} catch \(SQLException e\) \{
 System\.out\.print\("连接数据库失败"\)\;
 e\.printStackTrace\(\)\;
 this\.connection \= null\;
 \}
 \}

 /\*\*
 \* 使用XML配置登录
 \*/
 public void contectXML\(\)\{
 //创建解析器工厂
 DocumentBuilderFactory factory\=DocumentBuilderFactory\.newInstance\(\)\;

 //创建解析器
 DocumentBuilder builder\=factory\.newDocumentBuilder\(\)\;

 //创建dom树
 dom\=builder\.parse\("DataBassConfig\.xml"\)\;
 \}


 /\*\*
 \* 判断数据库是否已经关闭
 \*
 \* \@return 已经关闭返回\:true
 \*/
 public boolean isClose\(\) \{
 try \{
 return this\.connection\.isClosed\(\)\;
 \} catch \(SQLException e\) \{
 System\.out\.println\("数据库无法访问"\)\;
 e\.printStackTrace\(\)\;
 return false\;
 \}
 \}


 /\*\*
 \* 创建数据库
 \*/
 public void statement\(\) \{
 try \{
 statement \= connection\.createStatement\(\)\;
 \} catch \(SQLException e\) \{
 System\.err\.println\("无法创建数据库对象"\)\;
 statement \= null\;
 e\.printStackTrace\(\)\;
 \}
 \}

 /\*\*
 \* 执行SQL查询操作
 \*/
 public void runSQL\(\) \{
 try \{
 rs \= statement\.executeQuery\(this\.sqlCMD\)\;
 \} catch \(SQLException e\) \{
 System\.err\.println\("SQL查询未能执行"\)\;
 e\.printStackTrace\(\)\;
 \}
 \}

 /\*\*
 \* SQL查询自定义语句
 \*
 \* \@param strSQL SQL语句
 \*/
 public void runSQL\(String strSQL\) \{
 this\.setSqlCMD\(strSQL\)\;
 runSQL\(\)\;
 \}

 /\*\*
 \* SQL查询单行添加
 \* 语法\：insert into \<表名\> \[列名\] values \<列值\>
 \* 例\：insert into Strdents \(姓名\,性别\,出生日期\) values \('王伟华'\,'男'\,'1983/6/15'\)
 \*
 \* \@param insert_into 数据表名和字段名
 \* \@param values 值名\，逗号分割\，非数字用单引号标记\，多字段加括号
 \*/
 public void runSQL_add\(String insert_into\, String values\) \{
 runSQL\("insert into "\+insert_into\+" values "\+values\)\;
 \}

 /\*\*
 \* SQL查询删除数据所在的整行
 \* 语法\：delete from\< 表名\> \[where\< 删除条件\>\]
 \* 例\：delete from a where name\='王伟华'\（删除表a中列值为王伟华的行\）
 \*
 \* \@param tableName 数据表名
 \* \@param where 查询条件\（缺省\，全部删除\）
 \*/
 public void runSQL_del\(String tableName\, String where\) \{
 if \(where\.equals\(""\)\)\{
 runSQL\("delete from " \+ tableName\)\;
 \}else\{
 runSQL\("delete from " \+ tableName \+ " where " \+ where\)\;
 \}
 \}

 /\*\*
 \* SQL查询清空数据表
 \* 语法\：truncate table\< 表名\>
 \* \ 例\：truncate table addressList
 \*
 \* \@param tableName 数据表名
 \*/
 public void runSQL_clean\(String tableName\) \{
 runSQL\("truncate table " \+ tableName\)\;
 \}

 /\*\*
 \* SQL查询更改数据
 \* 语法\：update\< 表名\> set\< 列名\=更新值\> \[where\< 更新条件\>\]
 \* 例\：update addressList set 年龄\=18 where 姓名\='王伟华'
 \*
 \* \@param tableName 数据表名
 \* \@param set 更改后的值
 \* \@param where 需要更改的目标索引\，非数字用引号标记\，全部更新用星号"\*"标记
 \*/
 public void runSQL_update\(String tableName\, String set\, String where\) \{
 runSQL\("update " \+ tableName \+ " set " \+ set \+ " where " \+ where\)\;
 \}

 /\*\*
 \* SQL查询打印数据表全部行列
 \*
 \* \@param tableName 数据表名
 \* \@param where 索引条件\，非数字用引号标记\，全部更新用星号"\*"标记
 \*/
 public runSQL_select_print\(String tableName \,String where\) \{
 runSQL\("select \* from " \+ tableName\+" where "\+where\)\;
 \}


 /\*\*
 \* SQL查询打印数据表部分行列
 \* 例\：select i\,j\,k from a where f\=5
 \* 说明\：查询表a中f\=5的所有行\，并显示i\,j\,k３列
 \* \@param tableName 数据表名
 \* \@param columnNames 字段名\，逗号分割
 \* \@param where 索引条件\，非数字用引号标记\，缺省全部显示
 \*/
 public runSQL_select_print\(String tableName\, String columnNames\, String where\) \{
 if\(where\.equals\(""\)\)\{
 runSQL\("select " \+ columnNames \+ " from " \+ tableName\)\;
 \}else\{
 runSQL\("select " \+ columnNames \+ " from " \+ tableName \+ " where " \+ where\)\;
 \}
 \}

 /\*\*
 \* 对查询结果进行排序
 \* \@param tableName 数据表名
 \* \@param columnNames 字段名
 \* \@param where 索引条件
 \* \@param sort 排序方式\，asc升序\,desc降序
 \*/
 public runSQL_select_sort\(String tableName\,String columnNames\,String where\,String sort\)\{
 runSQL\("select "\+columnNames\+" from "\+tableName\+" where "\+where\+" order by "\+sort\)\;
 \}


 /\*\*
 \* 返回执行SQL查询的结果
 \*
 \* \@return
 \*/
 public ResultSet getResult\(\) \{
 if \(rs \=\= null\) \{
 System\.err\.println\("SQL查询未执行"\)\;
 return null\;
 \} else \{
 return rs\;
 \}
 \}

 /\*\*
 \* 关闭Result资源
 \*/
 public void closeResult\(\) \{
 try \{
 rs\.close\(\)\;
 \} catch \(SQLException e\) \{
 System\.err\.println\("Result关闭失败"\)\;
 e\.printStackTrace\(\)\;
 \}
 \}

 /\*\*
 \* 关闭数据库对象
 \*/
 public void closeStatement\(\) \{
 try \{
 statement\.close\(\)\;
 \} catch \(SQLException e\) \{
 System\.err\.println\("数据库关闭失败"\)\;
 e\.printStackTrace\(\)\;
 \}
 \}

 /\*\*
 \* 关闭数据库连接
 \*/
 public void closeConnection\(\) \{
 try \{
 connection\.close\(\)\;
 \} catch \(SQLException e\) \{
 System\.err\.println\("数据库关闭失败"\)\;
 e\.printStackTrace\(\)\;
 \}
 \}

 /\*\*
 \* 正常全部关闭
 \*/
 public void closeDataBase\(\) \{
 closeResult\(\)\;
 closeStatement\(\)\;
 closeConnection\(\)\;
 \}
\}
